import React, { useEffect } from "react";
import axios from "axios";
import { useState } from "react";

const Card = () => {
  const [img, setImage] = useState("");
  useEffect(() => {
    const current_data = async () => {
      const weather = await axios.get(
        "http://api.weatherapi.com/v1/current.json?key=21916b1a020d4a33bb534916203108&q=London"
      );
      console.log(weather.data.current.condition.icon);
    };
    current_data();
  });

  return (
    <>
      <h1>hello api</h1>
    </>
  );
};

export default Card;
